import React from 'react';

export default class Title extends React.Component{
    render(){
      return(
        <div>
         <p> Мемы ПОИТ</p>
         <p> ФОЧ</p>
         <p> Редев</p>
         <p> ПАША ЛОХ</p>
        </div>
      )
    }
  }
